data.Bio:
Double Faced Eels is a Latvian alternative rock band from Rīga, Latvia, formed in 2000. They initial sound draw influences from punk rock and pop music, with which they gained mainstream popularity in Latvia.

Members:

Reinis Straume - guitar, lead vocals;
Mārtiņš Gailītis - guitar, backing vocals;
Viktors Maslovs - bass;
Ronalds Briežkalns - drums.

Former members:

Olga Makejeva - vocals;
Reinis Briģis - guitar;
